import './App.css';
import Footer from './components/Footer';
import NavigationBar from './components/NavigationBar';
import Index from './pages/home/Index';
import {
  BrowserRouter as Router,Route
} from "react-router-dom";


function App() {
  return (
    <Router>
    <div className="App">
      <NavigationBar/>
      <Index/>
      <Footer/>



    </div>
    </Router>
  );
}

export default App;
